INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('In 1995, researchers were able to prove that a fifth state of matter — the Bose-Einstein condensate — could be created at very low temperatures. Until recently, this state of aggregation could only be generated using high-vacuum apparatus on Earth and was the state was extremely short-lived due to gravity. However, a German research team has now succeeded in generating and studying the Bose-Einstein condensate using an unmanned space rocket.', TIMESTAMP '2020-12-17 08:30:43', false, 24, 1, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('If you want to explore about more about this theme: https://www.forbes.com/sites/startswithabang/2020/06/09/what-are-the-fifth-and-sixth-states-of-matter/?sh=4c2c2c34a7fb', TIMESTAMP '2021-04-01 06:41:12', false, 37, 1, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Probably, combining Messi and Neymar football ability.', TIMESTAMP '2020-10-06 13:29:35', false, 27, 1, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I think that it is a lemur.', TIMESTAMP '2020-07-07 07:31:58', false, 22, 2, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Not sure, but it seems like a monkey.', TIMESTAMP '2021-02-25 06:49:52', false, 78, 2, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('You can open My Computer or My PC or whatever it is called which shows all your drives. Right click on USB drive and click on Eject.\nAnother way is, you can do it from notification icons at the down left corner. You will see an icon for USB device, click on it and select “Safely remove --device name--”.\nI hope you are talking about USB storage device though. Because other USB devices dont need to be safely removed.', TIMESTAMP '2020-06-26 13:49:00', false, 99, 3, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('You dont need to remove it safely.', TIMESTAMP '2020-10-07 10:46:47', false, 44, 3, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Goldfish can live for long periods of time if they are fed a varied diet and housed in proper water conditions. The average lifetime of a goldfish is ten to fifteen years.', TIMESTAMP '2021-03-03 19:35:39', false, 39, 4, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Maybe about 2 years', TIMESTAMP '2020-10-08 19:06:37', false, 73, 4, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Since goldfish have been domesticated for thousands of years, we can’t really examine their life expectancy under natural conditions in the wild. We know that their close cousin, the common carp, can live for up to 38 years in protected outdoor ponds and streams, though wild fish probably don’t survive much past 5 to 10 years.', TIMESTAMP '2020-11-25 22:40:52', false, 21, 4, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('It depends on the way they are treated. Some important conditions: water conditions, food, environment, etc.', TIMESTAMP '2020-09-05 04:38:05', true, 1, 4, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Every audio sample has whats known as an "acoustic fingerprint", which (like a human fingerprint) is basically a way to identify music based on things like tempo, bandwidth, and other audio features.\nIt then compares that acoustic fingerprint to the ones in their database, and if there is a "close enough" match, it returns the matched song information.', TIMESTAMP '2021-03-22 15:44:00', false, 11, 6, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Shazam identifies songs based on an audio fingerprint based on a time-frequency graph called a spectrogram. It uses a smartphone or computer´s built-in microphone to gather a brief sample of audio being played. Shazam stores a catalogue of audio fingerprints in a database. The user tags a song for 10 seconds and the application creates an audio fingerprint. Shazam works by analyzing the captured sound and seeking a match based on an acoustic fingerprint in a database of millions of songs.', TIMESTAMP '2020-12-12 07:10:50', true, 82, 6, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('In fact we know very little about the bottom of ocean because of the first thing is light does not penetrate and pressure is very high.\nThe bottom of ocean is the most sensitive layer that is more prone to volcanoes and earthquakes because of tectonic plates motion.\nThere were many researches made till now but they were unable to tell exactly, what is at the bottom of the ocean.', TIMESTAMP '2020-11-10 11:40:19', false, 81, 7, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Davey Jones’s Locker!', TIMESTAMP '2020-11-28 22:03:40', false, 76, 7, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I think the most realistic mechanism for getting more energy from the sun is to increase biomass energy schemes. Bio energy crops could produce a significant quantity of solar derived energy if the motivation were there.\nBio mass has the following adavantages:\n1. Energy created by burning biomass is CO2 neutral. CO2 produced in combustion is no more than the quantities of CO2 which the bio material broke down while they were growing.\n2. Biomass is incredibly cheap to "manufacture". You just plant seeds.\n3. There is no initial manufacturing energy cost. (For a long time photovoltaic solar cells required far more energy to produce than they could ever hope to recoup in their life.\n4. There are minimal building / construction / equipment area requirements. Large land areas of solar energy collection can be done with woodland / field crops etc. which can still be used for recreational use or production of wood / food etc.\n5. Biomass energy collectors are rarely objected to by environmentalists / Nimbys etc.', TIMESTAMP '2020-11-05 23:38:51', false, 2, 8, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I guess in general we are using energy absorbed from the Sun in one form or the other. Fossil fuels were formed from dead remains of flora and fauna which once thrived by either photosynthesis (requires sunlight) or feeding on plants. Nowadays more emphasis is laid on use of renewable sources of energy such as wind energy etc. I guess wind energy owes one of the factors to differential heating of different regions which is some form of solar energy converted into different other forms.', TIMESTAMP '2021-03-05 04:29:30', false, 78, 8, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I think we should forget that idea. Non renewable resources should be our main focus!', TIMESTAMP '2020-09-18 10:28:36', false, 24, 8, false);
