INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Yes, some people are still using Windows 95.\nSome games wont run on anything newer. As well, Windows 95 gets you very close to “real" DOS, even if it isnt an independent, separate DOS; actually, its MS-DOS 7.0, because MS-DOS 6.22 was the last independent DOS that was separate from Windows 3.x.\nSome people have very old computer hardware and apparently:\nthey have never heard of Linux,\ndont know how to use Linux,\nthe application they need to run wont run under WINE (WINE Is Not an Emulator) on Linux and\nwon’t run on any more modern operating system (except possibly in a virtualized environment, as I’ll explain below).\nThey just plain like running Windows 95\nA combination of the above.\nThat’s when Windows 95 is run directly on “bare metal”, as opposed to running it in a virtualized environment. However, it is possible, using either VMware Workstation Player or Oracle VirtualBox, to run Window 95 as a “virtual machine”, or VM. Running an operating system as a VM means that the virtualization software tricks the operating system into thinking it’s running directly on the metal-plastic-and-silicon hardware of a computer, when in fact, though it has an image file to load into RAM, the VM is available only as long as the virtualization software is active and the VM has been started and loaded into RAM.\nIt’s far safer, unless one absolutely must use Windows 95 on bare metal, as in points #3 and #4 above, to run Windows 95 in a virtualized environment. Anyway, Windows 95 won’t run on more modern hardware, and must never run directly on solid-state drive hardware. This is also true of Windows 98, Me, 2000, XP, and Vista (the last of which should never be run period. Ever). These operating systems were not designed for SSD technology and will destroy an SSD very quickly. The only Windows versions that can handle SSDs are Windows 7, 8.0, 8.1, and 10.', TIMESTAMP '2020-12-22 05:23:08', false, 61, 15, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I think nobody uses Windows 95 anymore.', TIMESTAMP '2021-01-14 21:43:12', false, 92, 15, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Yes people still use it, and in more ways than one.\nPeople who use win95 retail version extremely small number, probably for legacy support. Don’t recommend connecting to internet with it, or it’d catch a stupid amount of malware\nPeople who use a modified win95 larger number, but the software is custom built, and there is no rush to modernise it. Generally, they aren’t connected to the internet, and more often than not, they aren’t even on an intranet.\nPeople who use win95 for an unforeseen use this group is pretty small, but they are the cool group. I’ve used it for help with study, I’ve used it for fun, playing older games like doom and of the works.', TIMESTAMP '2021-03-26 22:13:45', false, 41, 15, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('The Universe is thought to consist of three types of substance: normal matter, "dark matter" and "dark energy". Normal matter consists of the atoms that make up stars, planets, human beings and every other visible object in the Universe.', TIMESTAMP '2021-02-26 02:53:34', false, 26, 16, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('As of now,we only have thorough knowledge about 5% of the universe,the rest 95% is completely unknown to us. Let me explain it to you in brief -\nBaryonic matter(normal matter)- This is the stuff that you and I are made of.gluons,baryons,quarks are all the fundamental sub atomic particles that go on to make supermassive stars,neutron stars,planets,galaxies and so on.but the interesting thing to know is this is only 5% of our observable universe.\nDark matter- As the name suggests,this is the matter that is totally in dark(unknown)to us right now.it consists of 25% of the critical density of our universe. The field of cosmology, astronomy and the whole astrophysics community has been scratching its heads for quite a long time to know its whereabouts.The problem is that dark matter does not interact with our normal matter as is the case with light.The only thing that makes it possible for us to know about its existence is its gravitational effect on normal matter.scientists and researchers have some assumptions about what it could be like,(WIMPS)weakly interacting massive particles,(SIMPS)strongly interacting massive particles but the right thing to say would be we just dont know yet.\nDark energy - This is the most mysterious form of energy that seems to permeate all of the space(75%).still it is completely unknown to us.we came to know about it through CMB(cosmic microwave background).We know that our universe is expanding since the big bang,but scientists thought that due to the effects of gravity,this expansion will slow down but rather we found that its accelerating. Something is causing it to expand at superluminal rate of speed.This something is what we refer to as dark energy.we do not have any idea on what it could be,but just some hypothesis that its cosmological constant(vacuum energy). scientists are conducting research and experiments on this subject but till now,we havent been able to trace it.', TIMESTAMP '2021-03-29 10:06:29', false, 51, 16, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('To answer your simply, cc stands for cubic centimeters- it represents the total capacity or volume of the cylinders in an engine(1000cc= 1L. eg. "1.2L" petrol engines,if you check their specs, you can find "engine displacement= 1193cc" or something in that range). Basically,it represents the amount of fuel-air mixture that can be injected/pumped into the engine at an instant. So, larger the cc or engine displacement,greater the power or torque developed by the engine.\nHence, cc cannot be used to describe the power of an electric powered vehicle because unlike a normal IC engine which uses a piston-cylinder arrangement (i.e.thermal energy of fuel combustion is converted to the up-down oscillations of the piston,which in turn is converted to a rotary output), electric motors produce rotary output directly.', TIMESTAMP '2020-08-08 14:36:53', false, 5, 17, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('CC means carbon copy. It is an email field that allows the sender to copy a message to one or more other addresses besides the main recipient.', TIMESTAMP '2021-01-30 13:05:40', false, 62, 17, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Blockchain seems complicated, and it definitely can be, but its core concept is really quite simple. A blockchain is a type of database. To be able to understand blockchain, it helps to first understand what a database actually is.\nA database is a collection of information that is stored electronically on a computer system. Information, or data, in databases is typically structured in table format to allow for easier searching and filtering for specific information. What is the difference between someone using a spreadsheet to store information rather than a database?\nSpreadsheets are designed for one person, or a small group of people, to store and access limited amounts of information. In contrast, a database is designed to house significantly larger amounts of information that can be accessed, filtered, and manipulated quickly and easily by any number of users at once.\nLarge databases achieve this by housing data on servers that are made of powerful computers. These servers can sometimes be built using hundreds or thousands of computers in order to have the computational power and storage capacity necessary for many users to access the database simultaneously. While a spreadsheet or database may be accessible to any number of people, it is often owned by a business and managed by an appointed individual that has complete control over how it works and the data within it.\nIf you want to know more details: https://www.investopedia.com/terms/b/blockchain.asp', TIMESTAMP '2020-12-15 01:27:59', false, 78, 18, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('A blockchain is a digital record of transactions. The name comes from its structure, in which individual records, called blocks, are linked together in single list, called a chain. Blockchains are used for recording transactions made with cryptocurrencies, such as Bitcoin, and have many other applications.', TIMESTAMP '2021-01-17 01:04:15', false, 85, 18, false);
