INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('We find the golden ratio when we divide a line into two parts so that: the long part divided by the short part is also equal to the whole length divided by the long part.', TIMESTAMP '2020-09-15 00:56:06', false, 84, 62, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('The Universe is thought to consist of three types of substance: normal matter, "dark matter" and "dark energy". Normal matter consists of the atoms that make up stars, planets, human beings and every other visible object in the Universe.', TIMESTAMP '2021-02-24 23:46:32', false, 29, 63, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('As of now,we only have thorough knowledge about 5% of the universe,the rest 95% is completely unknown to us. Let me explain it to you in brief -\nBaryonic matter(normal matter)- This is the stuff that you and I are made of.gluons,baryons,quarks are all the fundamental sub atomic particles that go on to make supermassive stars,neutron stars,planets,galaxies and so on.but the interesting thing to know is this is only 5% of our observable universe.\nDark matter- As the name suggests,this is the matter that is totally in dark(unknown)to us right now.it consists of 25% of the critical density of our universe. The field of cosmology, astronomy and the whole astrophysics community has been scratching its heads for quite a long time to know its whereabouts.The problem is that dark matter does not interact with our normal matter as is the case with light.The only thing that makes it possible for us to know about its existence is its gravitational effect on normal matter.scientists and researchers have some assumptions about what it could be like,(WIMPS)weakly interacting massive particles,(SIMPS)strongly interacting massive particles but the right thing to say would be we just dont know yet.\nDark energy - This is the most mysterious form of energy that seems to permeate all of the space(75%).still it is completely unknown to us.we came to know about it through CMB(cosmic microwave background).We know that our universe is expanding since the big bang,but scientists thought that due to the effects of gravity,this expansion will slow down but rather we found that its accelerating. Something is causing it to expand at superluminal rate of speed.This something is what we refer to as dark energy.we do not have any idea on what it could be,but just some hypothesis that its cosmological constant(vacuum energy). scientists are conducting research and experiments on this subject but till now,we havent been able to trace it.', TIMESTAMP '2020-12-02 21:31:36', false, 39, 63, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('In 1995, researchers were able to prove that a fifth state of matter — the Bose-Einstein condensate — could be created at very low temperatures. Until recently, this state of aggregation could only be generated using high-vacuum apparatus on Earth and was the state was extremely short-lived due to gravity. However, a German research team has now succeeded in generating and studying the Bose-Einstein condensate using an unmanned space rocket.', TIMESTAMP '2020-12-13 04:43:55', false, 30, 64, true);
