INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I would like to say that Francium is without any doubt one of the craziest elements in the periodic table. It is found all the way down in the alkali metal group and this is one of the main reasons for its amazing properties. The reason behind why elements far down in the alkali metal group are so interesting and crazy, as people say, is because they have a valence electron that lies so far away from the nucleus. Because they have their valence electron far away from the nucleus they sit “looser” because the nucleus doesn’t attract them as hard. Therefore, the electron is more prone to leave the atom and react with other substances.', TIMESTAMP '2021-01-30 09:40:20', false, 78, 91, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Prime numbers are weird because of their properties and relations with the number line. For one, every single integer number can be written as a unique product of prime numbers. Thus, in a sense the whole integer number line is contained within the primes. In addition, there are many very interesting mathematical theorems that are intimately linked with primes in a non-trivial manner. For instance, the Riemann hypothesis is an unproven statement in complex analysis, but can be shown to have a very clear link with prime numbers and applications in number theory.', TIMESTAMP '2021-02-20 11:27:56', false, 63, 92, false);
