INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I think the most realistic mechanism for getting more energy from the sun is to increase biomass energy schemes. Bio energy crops could produce a significant quantity of solar derived energy if the motivation were there.\nBio mass has the following adavantages:\n1. Energy created by burning biomass is CO2 neutral. CO2 produced in combustion is no more than the quantities of CO2 which the bio material broke down while they were growing.\n2. Biomass is incredibly cheap to "manufacture". You just plant seeds.\n3. There is no initial manufacturing energy cost. (For a long time photovoltaic solar cells required far more energy to produce than they could ever hope to recoup in their life.\n4. There are minimal building / construction / equipment area requirements. Large land areas of solar energy collection can be done with woodland / field crops etc. which can still be used for recreational use or production of wood / food etc.\n5. Biomass energy collectors are rarely objected to by environmentalists / Nimbys etc.', TIMESTAMP '2021-01-15 20:22:01', false, 58, 119, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I guess in general we are using energy absorbed from the Sun in one form or the other. Fossil fuels were formed from dead remains of flora and fauna which once thrived by either photosynthesis (requires sunlight) or feeding on plants. Nowadays more emphasis is laid on use of renewable sources of energy such as wind energy etc. I guess wind energy owes one of the factors to differential heating of different regions which is some form of solar energy converted into different other forms.', TIMESTAMP '2020-10-08 19:57:55', false, 36, 119, false);
