INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Every audio sample has whats known as an "acoustic fingerprint", which (like a human fingerprint) is basically a way to identify music based on things like tempo, bandwidth, and other audio features.\nIt then compares that acoustic fingerprint to the ones in their database, and if there is a "close enough" match, it returns the matched song information.', TIMESTAMP '2020-10-11 08:43:14', false, 64, 120, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Shazam identifies songs based on an audio fingerprint based on a time-frequency graph called a spectrogram. It uses a smartphone or computer´s built-in microphone to gather a brief sample of audio being played. Shazam stores a catalogue of audio fingerprints in a database. The user tags a song for 10 seconds and the application creates an audio fingerprint. Shazam works by analyzing the captured sound and seeking a match based on an acoustic fingerprint in a database of millions of songs.', TIMESTAMP '2020-08-10 14:43:29', false, 30, 120, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('To keep things really simple we have to generalize, but lets generalize down to two simple categories.\nHow what you do makes your computer slower “locally”: Your operating system (OS) keeps logs of operation that happen on your computer. Over millions of those operations, many go wrong, it can often fix those mistakes or it can try to bypass them if it cannot. This is often due to sloppy coding in the OS’s creator part, or that of dozens of other software you might be running on it. As those accumulate, depending on your OS there might be a slow-down that can actually go away if you were to install your OS and applications from scratch.\nHow what we are doing with our devices gets gradually harder: What you ask your computer to do gets harder/more complicated over time. E.g. browsing the internet these days is pretty intensive from a hardware point of view. Games, especially “the latest and greatest” from visual standpoint, often require the latest and greatest hardware-wise.\nes, they could dumb it down for older machines, but when the vast majority of their users or at least the users the marketing curators prioritize (it is those that spend the most money ofc) are connected through newer devices, they often optimize the content or the way the content is delivered with the best experience of those in mind. And it makes sense, it is they who pay most of the bill or that will be willing to pay more. People with older machines are 2nd priority.', TIMESTAMP '2020-12-12 12:03:33', false, 37, 121, false);
