INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Prime numbers are weird because of their properties and relations with the number line. For one, every single integer number can be written as a unique product of prime numbers. Thus, in a sense the whole integer number line is contained within the primes. In addition, there are many very interesting mathematical theorems that are intimately linked with primes in a non-trivial manner. For instance, the Riemann hypothesis is an unproven statement in complex analysis, but can be shown to have a very clear link with prime numbers and applications in number theory.', TIMESTAMP '2021-03-22 22:32:52', false, 70, 128, true);
