INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('To keep things really simple we have to generalize, but lets generalize down to two simple categories.\nHow what you do makes your computer slower “locally”: Your operating system (OS) keeps logs of operation that happen on your computer. Over millions of those operations, many go wrong, it can often fix those mistakes or it can try to bypass them if it cannot. This is often due to sloppy coding in the OS’s creator part, or that of dozens of other software you might be running on it. As those accumulate, depending on your OS there might be a slow-down that can actually go away if you were to install your OS and applications from scratch.\nHow what we are doing with our devices gets gradually harder: What you ask your computer to do gets harder/more complicated over time. E.g. browsing the internet these days is pretty intensive from a hardware point of view. Games, especially “the latest and greatest” from visual standpoint, often require the latest and greatest hardware-wise.\nes, they could dumb it down for older machines, but when the vast majority of their users or at least the users the marketing curators prioritize (it is those that spend the most money ofc) are connected through newer devices, they often optimize the content or the way the content is delivered with the best experience of those in mind. And it makes sense, it is they who pay most of the bill or that will be willing to pay more. People with older machines are 2nd priority.', TIMESTAMP '2020-09-12 12:30:06', false, 4, 143, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('You just need to upgrade your PC regularly', TIMESTAMP '2021-01-03 11:19:08', false, 100, 143, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('32gb of ram is the new standard', TIMESTAMP '2020-08-13 00:35:11', false, 5, 143, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('They don’t. Barring the installation of software that has a higher demand for resources than the older system can deliver most “slow downs” occur because people pick up garbage, usually from the internet, which is generally malware that uses up their available memory\nAs a result memory management becomes the primary cause of errors and slowing down.\nThis is also a reason why. In the absence of any analysis, it is generally considered that adding memory will usually improve performance on a system regardless of other factors.', TIMESTAMP '2020-10-25 01:54:36', false, 86, 143, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('The laws of physics stop computers getting faster forever. Computers calculate at the tick of an internal clock, so for many years manufacturers made transistors smaller and clocks faster to make them perform more computations per second. However, conventional electronics get too hot if you make them calculate too fast, which is why we no longer see clock speeds increasing much. Instead we now have more and more ‘cores’ – lots of processors all calculating in parallel – to let them do more work in the same time. Which means that yes, computers can and will keep getting faster.', TIMESTAMP '2021-01-26 06:43:39', false, 61, 144, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('No they cannot.', TIMESTAMP '2021-02-10 17:16:23', false, 82, 144, true);
