INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('The Universe is thought to consist of three types of substance: normal matter, "dark matter" and "dark energy". Normal matter consists of the atoms that make up stars, planets, human beings and every other visible object in the Universe.', TIMESTAMP '2021-02-25 05:54:49', false, 20, 209, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('As of now,we only have thorough knowledge about 5% of the universe,the rest 95% is completely unknown to us. Let me explain it to you in brief -\nBaryonic matter(normal matter)- This is the stuff that you and I are made of.gluons,baryons,quarks are all the fundamental sub atomic particles that go on to make supermassive stars,neutron stars,planets,galaxies and so on.but the interesting thing to know is this is only 5% of our observable universe.\nDark matter- As the name suggests,this is the matter that is totally in dark(unknown)to us right now.it consists of 25% of the critical density of our universe. The field of cosmology, astronomy and the whole astrophysics community has been scratching its heads for quite a long time to know its whereabouts.The problem is that dark matter does not interact with our normal matter as is the case with light.The only thing that makes it possible for us to know about its existence is its gravitational effect on normal matter.scientists and researchers have some assumptions about what it could be like,(WIMPS)weakly interacting massive particles,(SIMPS)strongly interacting massive particles but the right thing to say would be we just dont know yet.\nDark energy - This is the most mysterious form of energy that seems to permeate all of the space(75%).still it is completely unknown to us.we came to know about it through CMB(cosmic microwave background).We know that our universe is expanding since the big bang,but scientists thought that due to the effects of gravity,this expansion will slow down but rather we found that its accelerating. Something is causing it to expand at superluminal rate of speed.This something is what we refer to as dark energy.we do not have any idea on what it could be,but just some hypothesis that its cosmological constant(vacuum energy). scientists are conducting research and experiments on this subject but till now,we havent been able to trace it.', TIMESTAMP '2021-01-21 17:26:10', false, 63, 209, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Yes, some people are still using Windows 95.\nSome games wont run on anything newer. As well, Windows 95 gets you very close to “real" DOS, even if it isnt an independent, separate DOS; actually, its MS-DOS 7.0, because MS-DOS 6.22 was the last independent DOS that was separate from Windows 3.x.\nSome people have very old computer hardware and apparently:\nthey have never heard of Linux,\ndont know how to use Linux,\nthe application they need to run wont run under WINE (WINE Is Not an Emulator) on Linux and\nwon’t run on any more modern operating system (except possibly in a virtualized environment, as I’ll explain below).\nThey just plain like running Windows 95\nA combination of the above.\nThat’s when Windows 95 is run directly on “bare metal”, as opposed to running it in a virtualized environment. However, it is possible, using either VMware Workstation Player or Oracle VirtualBox, to run Window 95 as a “virtual machine”, or VM. Running an operating system as a VM means that the virtualization software tricks the operating system into thinking it’s running directly on the metal-plastic-and-silicon hardware of a computer, when in fact, though it has an image file to load into RAM, the VM is available only as long as the virtualization software is active and the VM has been started and loaded into RAM.\nIt’s far safer, unless one absolutely must use Windows 95 on bare metal, as in points #3 and #4 above, to run Windows 95 in a virtualized environment. Anyway, Windows 95 won’t run on more modern hardware, and must never run directly on solid-state drive hardware. This is also true of Windows 98, Me, 2000, XP, and Vista (the last of which should never be run period. Ever). These operating systems were not designed for SSD technology and will destroy an SSD very quickly. The only Windows versions that can handle SSDs are Windows 7, 8.0, 8.1, and 10.', TIMESTAMP '2021-02-02 07:20:20', false, 77, 210, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('I think nobody uses Windows 95 anymore.', TIMESTAMP '2021-02-16 04:39:39', false, 51, 210, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Yes people still use it, and in more ways than one.\nPeople who use win95 retail version extremely small number, probably for legacy support. Don’t recommend connecting to internet with it, or it’d catch a stupid amount of malware\nPeople who use a modified win95 larger number, but the software is custom built, and there is no rush to modernise it. Generally, they aren’t connected to the internet, and more often than not, they aren’t even on an intranet.\nPeople who use win95 for an unforeseen use this group is pretty small, but they are the cool group. I’ve used it for help with study, I’ve used it for fun, playing older games like doom and of the works.', TIMESTAMP '2020-11-28 23:27:05', false, 59, 210, true);
