INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('We find the golden ratio when we divide a line into two parts so that: the long part divided by the short part is also equal to the whole length divided by the long part.', TIMESTAMP '2020-09-25 20:36:14', false, 38, 215, false);
