INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Since goldfish have been domesticated for thousands of years, we can’t really examine their life expectancy under natural conditions in the wild. We know that their close cousin, the common carp, can live for up to 38 years in protected outdoor ponds and streams, though wild fish probably don’t survive much past 5 to 10 years.', TIMESTAMP '2021-02-17 08:04:34', false, 89, 224, true);
