INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Yes, all companies prefer macbooks. There is no reason to ever pick any other laptop over a macbook due to its convenience and near-linux experience.', TIMESTAMP '2021-03-17 09:49:34', false, 68, 233, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Technetium. He has a metallic descent, surrounded by stable elements on all sides. But he has one trait that makes him strange- almost like that wacky cousin in every family.', TIMESTAMP '2020-12-27 10:57:28', false, 5, 234, false);
