INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('To answer your simply, cc stands for cubic centimeters- it represents the total capacity or volume of the cylinders in an engine(1000cc= 1L. eg. "1.2L" petrol engines,if you check their specs, you can find "engine displacement= 1193cc" or something in that range). Basically,it represents the amount of fuel-air mixture that can be injected/pumped into the engine at an instant. So, larger the cc or engine displacement,greater the power or torque developed by the engine.\nHence, cc cannot be used to describe the power of an electric powered vehicle because unlike a normal IC engine which uses a piston-cylinder arrangement (i.e.thermal energy of fuel combustion is converted to the up-down oscillations of the piston,which in turn is converted to a rotary output), electric motors produce rotary output directly.', TIMESTAMP '2020-12-18 16:14:53', false, 20, 276, false);
