INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('To keep things really simple we have to generalize, but lets generalize down to two simple categories.\nHow what you do makes your computer slower “locally”: Your operating system (OS) keeps logs of operation that happen on your computer. Over millions of those operations, many go wrong, it can often fix those mistakes or it can try to bypass them if it cannot. This is often due to sloppy coding in the OS’s creator part, or that of dozens of other software you might be running on it. As those accumulate, depending on your OS there might be a slow-down that can actually go away if you were to install your OS and applications from scratch.\nHow what we are doing with our devices gets gradually harder: What you ask your computer to do gets harder/more complicated over time. E.g. browsing the internet these days is pretty intensive from a hardware point of view. Games, especially “the latest and greatest” from visual standpoint, often require the latest and greatest hardware-wise.\nes, they could dumb it down for older machines, but when the vast majority of their users or at least the users the marketing curators prioritize (it is those that spend the most money ofc) are connected through newer devices, they often optimize the content or the way the content is delivered with the best experience of those in mind. And it makes sense, it is they who pay most of the bill or that will be willing to pay more. People with older machines are 2nd priority.', TIMESTAMP '2020-11-21 09:59:24', false, 51, 297, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('You just need to upgrade your PC regularly', TIMESTAMP '2021-02-11 07:24:04', false, 65, 297, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('32gb of ram is the new standard', TIMESTAMP '2021-01-29 15:31:36', false, 17, 297, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('They don’t. Barring the installation of software that has a higher demand for resources than the older system can deliver most “slow downs” occur because people pick up garbage, usually from the internet, which is generally malware that uses up their available memory\nAs a result memory management becomes the primary cause of errors and slowing down.\nThis is also a reason why. In the absence of any analysis, it is generally considered that adding memory will usually improve performance on a system regardless of other factors.', TIMESTAMP '2021-02-03 08:11:51', false, 20, 297, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('To answer your simply, cc stands for cubic centimeters- it represents the total capacity or volume of the cylinders in an engine(1000cc= 1L. eg. "1.2L" petrol engines,if you check their specs, you can find "engine displacement= 1193cc" or something in that range). Basically,it represents the amount of fuel-air mixture that can be injected/pumped into the engine at an instant. So, larger the cc or engine displacement,greater the power or torque developed by the engine.\nHence, cc cannot be used to describe the power of an electric powered vehicle because unlike a normal IC engine which uses a piston-cylinder arrangement (i.e.thermal energy of fuel combustion is converted to the up-down oscillations of the piston,which in turn is converted to a rotary output), electric motors produce rotary output directly.', TIMESTAMP '2020-11-16 03:01:37', false, 48, 298, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('CC means carbon copy. It is an email field that allows the sender to copy a message to one or more other addresses besides the main recipient.', TIMESTAMP '2021-03-13 10:23:22', false, 99, 298, false);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('The Universe is thought to consist of three types of substance: normal matter, "dark matter" and "dark energy". Normal matter consists of the atoms that make up stars, planets, human beings and every other visible object in the Universe.', TIMESTAMP '2021-03-13 07:50:07', false, 95, 299, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('As of now,we only have thorough knowledge about 5% of the universe,the rest 95% is completely unknown to us. Let me explain it to you in brief -\nBaryonic matter(normal matter)- This is the stuff that you and I are made of.gluons,baryons,quarks are all the fundamental sub atomic particles that go on to make supermassive stars,neutron stars,planets,galaxies and so on.but the interesting thing to know is this is only 5% of our observable universe.\nDark matter- As the name suggests,this is the matter that is totally in dark(unknown)to us right now.it consists of 25% of the critical density of our universe. The field of cosmology, astronomy and the whole astrophysics community has been scratching its heads for quite a long time to know its whereabouts.The problem is that dark matter does not interact with our normal matter as is the case with light.The only thing that makes it possible for us to know about its existence is its gravitational effect on normal matter.scientists and researchers have some assumptions about what it could be like,(WIMPS)weakly interacting massive particles,(SIMPS)strongly interacting massive particles but the right thing to say would be we just dont know yet.\nDark energy - This is the most mysterious form of energy that seems to permeate all of the space(75%).still it is completely unknown to us.we came to know about it through CMB(cosmic microwave background).We know that our universe is expanding since the big bang,but scientists thought that due to the effects of gravity,this expansion will slow down but rather we found that its accelerating. Something is causing it to expand at superluminal rate of speed.This something is what we refer to as dark energy.we do not have any idea on what it could be,but just some hypothesis that its cosmological constant(vacuum energy). scientists are conducting research and experiments on this subject but till now,we havent been able to trace it.', TIMESTAMP '2021-03-27 17:28:51', false, 91, 299, true);
INSERT INTO answer (answer_body, answer_date, misinformation, author, question_id, highlight) VALUES ('Direct proof: n^5−5.n^3+4.n=(n−2)(n−1)(n)(n+1)(n+2). 120=2^3.3.5. Among the terms n−2,n−1,…,n+2 at least one of them will be divisible by five, at least one will be divisible by three, at least one divisible by four and at least one more other than the one divisible by four will also be divisible by two.', TIMESTAMP '2020-12-26 16:22:52', false, 91, 300, false);
